import { ShopProduct } from './shop-product.model';
export class ShopCategory {
  constructor(partial) {
    Object.assign(this, partial);
  }
  deserialize(input) {
    Object.assign(this, input);
    this.products = input.products.map(p => new ShopProduct({
      ...p
    }).deserialize(p));
    return this;
  }
}
